import DiamondRingImg from './diamond-ring.png';

const DiamondRing = {
  name: 'Diamond Ring',
  type: 'ring',
  effect: {
    defence: 15,
    hp: 20,
    mana: 15,
  },
  image: DiamondRingImg,
  value: 250,
};

export default DiamondRing;
